CREATE TABLE `incidencia` (
  `idincidencia` bigint NOT NULL AUTO_INCREMENT,
  `costo` double DEFAULT NULL,
  `descripcion` varchar(255) NOT NULL,
  `esta_pagado` tinyint DEFAULT NULL,
  `estado` tinyint DEFAULT NULL,
  `fecha_registro` date DEFAULT NULL,
  `categoria_idcategoria` bigint NOT NULL,
  `ciudadano_idciudadano` bigint DEFAULT NULL,
  `comite_idcomite` bigint DEFAULT NULL,
  PRIMARY KEY (`idincidencia`),
  KEY `FK780hhq8xv36lll81etv5g3wqw` (`categoria_idcategoria`),
  KEY `FKf4j5y94ixwsochu9q0o3rotpo` (`ciudadano_idciudadano`),
  KEY `FKhh0cih3j773g5g4iqyfn2bgju` (`comite_idcomite`),
  CONSTRAINT `FK780hhq8xv36lll81etv5g3wqw` FOREIGN KEY (`categoria_idcategoria`) REFERENCES `categoria` (`idcategoria`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FKf4j5y94ixwsochu9q0o3rotpo` FOREIGN KEY (`ciudadano_idciudadano`) REFERENCES `ciudadano` (`idciudadano`) ON DELETE CASCADE ON UPDATE CASCADE,
